import React from 'react';
import { Link } from 'react-router-dom';
import { NavLink } from 'react-router-dom';

function ClientSidebar() {
    return (
        <aside className="sidenav">
            <img src={require('./Assets/PrakriaLogo_Final.png')} alt="Prakria Direct Logo" className='Logo' />
            <button className='create-btn'>Create a project</button>
            <nav className='nav-menu'>
                <ul>
                    <li><NavLink to={"/client/projects"} activeStyle={{
                        fontWeight: 'bold',
                        color: 'red'
                    }}>Projects</NavLink></li>
                    <li><Link to={"/client/brands"}>Brands</Link></li>
                    <li><Link to={"/client/files"}>Files</Link></li>
                    <li><Link to={"/client/resource"}>Add a Resource</Link></li>
                    <li><Link to={"/client/account"}>Account</Link></li>
                    <li>Logout</li>
                </ul>
            </nav>
        </aside>
    );
}

export default ClientSidebar;
